import { Text } from "./components";

export default function App() {
  return (
    <div className="App">
      <Text as="h1">Hello CodeSnadeBox</Text>

      <Text as="h2" href="https://www.google.com">
        Start editing to see some magic happen!
      </Text>
      <Text as="h2" href="https://www.google.com">
        Bonjour La monde C'est Ali
      </Text>
    </div>
  );
}
